import React from 'react'
// import top2 from '../components/Img/top2.png'
function Timetable() {
    return (
        <>
            <div className='absolute top-1/2 left-1/2 trans h-[400px] w-[1200px] shadow-lg flex'>
                <div className='w-[calc(50%-50px)] h-full bg-black px-[2%] py-[5%] text-[18px]'></div>
                <div className='w-[calc(50%+50px)] h-full bg-white px-[2%] py-[5%] text-[18px]'></div>
            </div>
        </>
    )
}

export default Timetable
